      <ul>
        <li><Link to="/shop">Shop</Link></li>
        <li><Link to="/about">Ã€ Propos</Link></li>
        <li><Link to="/contact">Contact</Link></li>
      </ul>
      {!hideAuthIcon && (
        <div className="auth-icon">
          <img
            src="https://cdn-icons-png.flaticon.com/512/1077/1077063.png"
